def init_gamma_table(args):
    if args.proj_name == 'xiaomi':
        args.inv_src_gamma = lut_table.xiaomi_inv_bps_gamma
        args.src_gamma = lut_table.xiaomi_bps_gamma
        args.inv_dst_gamma = lut_table.xiaomi_inv_bps_gamma
        args.dst_gamma = lut_table.xiaomi_bps_gamma
    elif args.proj_name == 'honor':
        args.inv_src_gamma = lut_table.honor_inv_bps_gamma
        args.src_gamma = lut_table.honor_bps_gamma
        args.inv_dst_gamma = lut_table.honor_inv_bps_gamma
        args.dst_gamma = lut_table.honor_bps_gamma
        args.ipe_gamma = lut_table.honor_ipe_gamma
        args.ipe_inv_gamma = lut_table.honor_inv_ipe_gamma
    elif args.proj_name == 'xiaomi_raw':
        args.inv_src_gamma = lut_table.xiaomi_raw_inv_bps_gamma
        args.src_gamma = lut_table.xiaomi_raw_bps_gamma
        args.inv_dst_gamma = lut_table.xiaomi_inv_ipe_gamma
        args.dst_gamma = lut_table.xiaomi_ipe_gamma
        args.ipe_gamma = lut_table.xiaomi_ipe_gamma
        args.ipe_inv_gamma = lut_table.xiaomi_inv_ipe_gamma
    elif args.proj_name == 'sdk':
        args.src_gamma     = lut_table.honor_ipe_gamma
        args.inv_src_gamma = lut_table.honor_inv_bps_gamma
        args.inv_dst_gamma = lut_table.honor_inv_ipe_gamma
    elif args.proj_name == 'raw':
        args.src_gamma     = lut_table.linear_bps_gamma
        args.inv_src_gamma = lut_table.linear_inv_bps_gamma
        # args.inv_dst_gamma = lut_table.honor_inv_ipe_gamma
        args.dst_gamma = lut_table.moto_bps_gamma
        args.inv_dst_gamma = lut_table.moto_inv_bps_gamma
        args.ipe_gamma = lut_table.honor_ipe_gamma
        args.inv_ipe_gamma = lut_table.honor_inv_ipe_gamma

    

    else:
        raise(ValueError("Do not recognize project name: {}".format(args.proj_name)))

    # tmp
